class Syllabus {
  constructor(a, b, c, d, e) {
    //super(props)

    this.syllabusId = a;
    this.syllabusTitle = b;
    this.sections = {
      sectionId: '',
      sectionNumber: c,
      sectionTitle: d
    };
    this.lessons = [
      {
        lessonId: '',
        lessonTitle: e
      }
    ];
  }

  print() {
    return console.log(
      `${this.syllabusTitle} is section# ${this.sections.sectionNumber}`
    );
  }

  idMaker() {
    let id = Math.floor(Math.random() * 10);
    return console.log(id);
  }

  render() {
    const maxReact = new Syllabus(
      'maxReact1',
      'maxReact',
      '11',
      'Use this in functions',
      '11.Read all about this'
    );

    return maxReact;
  }
}

export default Syllabus;
